import MyComponent from './MyComponent'

class App extends Component{
    constructor(props){
        super(props);

        this.state = {
            checked: true,
            title: 'Initial Title',
            name: 'Initial name',
            shouldRenderTitle: false
        };
    }

    renderTitle(){
        if(!this.state.shouldRenderTitle) return null

        return <h1>Title</h1>
    }

    render(){
        return (
            <div className= "App">
                <input 
                    type="checkbox"
                    onChange={() =>this.updateCheck}
                    vaule={this.state.name} />
            </div>
        )
    }
}

export default App;
